import React from "react";
import PropTypes from "prop-types";

import "./Home.scss";
import Category from "../Categories/Category";

const Home = (props) => {
  return (
    <div>
      <Category> Quần áo</Category>
      <Category> Giày</Category>
      <Category> Phụ kiện</Category>
    </div>
  );
};

Home.propTypes = {};

export default Home;
